import React from "react";
import GoogleMapReact from 'google-map-react';

export const GoogleMaps = () => {
    const containerStyle = {
        width: "100%",
        height: "100vh",
    }

    const defaultProps = {
        center: {
            lat: 10.99835602,
            lng: 77.01502627
        },
        zoom: 11
    };

    return (
        <div style={{ height: '100vh', width: '100%' }}>
            <GoogleMapReact
                bootstrapURLKeys={{ key: "AIzaSyBhVXUVndfSpP7dLmTY0mgQskPu4hWADOw" }}
                defaultCenter={defaultProps.center}
                defaultZoom={defaultProps.zoom}
            >
                <span
                    lat={59.955413}
                    lng={30.337844}
                    text="My Marker"
                />
            </GoogleMapReact>
        </div>
    );
};
